import classNames from "classnames";
import { useState } from "react";
import styles from "./styles.module.css";
const packs = {
  start: 'start',
  max: 'max',
  base: 'base'
}

export const EditPackagePopup = ({ togglePopup }) => {
  const [pack, setPack] = useState(packs.start)
  return (
    <div className={styles.popup_wrapper}>
      <div className={styles.popup}>
        <button
          className={classNames(styles.button, styles.popup_closeButton)}
          type="button"
          onClick={() => togglePopup()}
        />
        <div className={styles.radios_container}>
        <div className={styles.radio_container}>
            <input
              className={styles.radio}
              type="radio"
              value={pack.start}
              onChange={() => setPack(packs.start)}
              checked={pack === packs.start}
            />
            {packs.start}
            <label className={styles.label_radio}></label>
          </div>
        </div>
      </div>
    </div>
  );
};
